import React, { Component } from "react";
import { MDBContainer,
MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline,
MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem
} from "mdbreact";

import { BrowserRouter as Router } from 'react-router-dom';

import picture from "../pictures/IMG_6767.JPG";
import "../index.css";

class NavbarPage extends Component {
state = {
    activeItem: "1"
}

toggle = tab => () => {
    if (this.state.activeItem !== tab) {
    this.setState({
    activeItem: tab
    });
    }
}

render() {
  return (
    <MDBContainer>
      <MDBNavbar color="indigo" dark expand="md" fixed="top">

        <MDBNavbarBrand>
            <img id="pic" src={picture} />
            <strong id="haut" className="white-text">MonCV</strong>
        </MDBNavbarBrand>

        <MDBNavbarToggler onClick={this.toggleCollapse} />

        <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>

          <MDBNavbarNav left>
            <MDBNavItem>
                <MDBNavLink link to="#"
              active={this.state.activeItem === "1"}
              onClick={this.toggle("1")}
              role="tab">Contact</MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
                <MDBNavLink to="#!">Compétences</MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
                <MDBNavLink to="#!">Expériences</MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
                <MDBNavLink to="#!">Formation</MDBNavLink>
            </MDBNavItem>
          </MDBNavbarNav>

          <MDBNavbarNav right>
            <MDBNavItem>
              <MDBFormInline waves>
                <div className="md-form my-0">
                  <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search" />
                </div>
              </MDBFormInline>
            </MDBNavItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBNavbar>
    </MDBContainer>
    );
  }
}

export default NavbarPage;
